// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "./Marketplace.sol";
import "./Ownable.sol";

/// @title Clock auction modified for sale of Pieces
contract PieceMarketplace is Ownable, Marketplace {

    constructor(address _nftAddr, uint256 _cut, address _mekaToken) Marketplace(_nftAddr, _cut, _mekaToken) {}

    /// @dev Creates and begins a new sale.
    /// @param _tokenId - ID of token to sale, sender must be owner.
    /// @param _startingPrice - Price of item (in wei).
    /// @param _seller - Seller, if not the message sender
    function createSale(
        uint256 _tokenId,
        uint256 _appearenceId,
        address _contributorAddress,
        uint256 _startingPrice,
        address _seller
    )
        override external
    {
        require(msg.sender == address(nonFungibleContract), "only nft contract");

        _escrow(_seller, _tokenId);
        Sale memory auction = Sale(
            _seller,
            _appearenceId,
            _contributorAddress,
            _startingPrice,
            uint64(block.timestamp)
        );
        _addSale(_tokenId, auction);
    }

    function setShouldPayContributor() external onlyOwner{
        shouldPayContributor = !shouldPayContributor;
    }
}

